import React from 'react';
import { Menu } from 'antd';
import { AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
import "./Header.scss";
const { SubMenu } = Menu;
const  handleClick=(e) =>{
    console.log(e.target);
}
const Header = () => {
    return (
        <>
            <Menu inlineCollapsed ={false} onClick={handleClick} selectedKeys={"hehe"} mode="horizontal">
                <Menu.Item className="logo-item" key="mail">
                    <img width="30px" src="../images/logo.png" ></img>
                </Menu.Item>
                <Menu.Item key="app">
                   Gây quỹ
                </Menu.Item>
                <Menu.Item key="about">
                   Về chúng thôi
                </Menu.Item>
                <Menu.Item key="contact">
                   Liên hệ
                </Menu.Item>
                <Menu.Item key="login" className="right" >
                   Đăng nhập
                </Menu.Item>
                <Menu.Item key="sign-up" className="right">
                   Đăng kí
                </Menu.Item>
            </Menu>
        </>
    );
}

export default Header;
